import React,{useContext} from 'react';
import {Button,Image} from 'react-bootstrap';
//Styles
import Styles from './Switch.module.css';
//hook-Logic
import useSwitch from './useSwitch';
import ProfilePicture from '../Card/Image/usuario.svg'

const Switch = ()=>{
    const [ActiveButton,ButtonRef] = useSwitch();
    let current;
    if (ActiveButton.search){
        current = 'search';
    }else{
        current = 'profile';
    }
    return (
    <div>
        <Button className = {Styles.button} ref = {ButtonRef} variant = 'dark'>{current}</Button>
        <div className = {Styles.ImageContainer}>
            <a href = '#'>
                <Image src ={ProfilePicture}></Image>s
            </a>    
        </div>
    </div>  
        
    )
}
export default Switch;
